using ShineEngine;

/// <summary>
/// 进入场景失败消息(generated by shine)
/// </summary>
public class EnterSceneFailedResponse:GameResponse
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=GameResponseType.EnterSceneFailed;
	
	public EnterSceneFailedResponse()
	{
		_dataID=GameResponseType.EnterSceneFailed;
	}
	
	/// <summary>
	/// 执行
	/// </summary>
	protected override void execute()
	{
		GameC.scene.onEnterSceneFailed();
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "EnterSceneFailedResponse";
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		base.toReadBytesFull(stream);
		
		stream.startReadObj();
		
		stream.endReadObj();
	}
	
}
